この液晶サンバイザーは光に反応して液晶パネルの濃度を自動で調整し、眩しい時は濃く日陰ではクリアな状態に色を一瞬で変化させ眩しさを軽減する全く新しい商品です。偏光機能付きなので太陽光だけでなくギラツキを防ぎ、眼の疲労を抑えます。可視光線に反応し、変化速度は0.2～0.5秒、車外の明るさの変化を光センサーで感知し液晶パネルの色を常に最適な濃度に調整します。パネルの濃度は手動で調整可能。紫外線は99%、有害なブルーライト、高エネルギー可視光線は85%以上カットし大切な眼を守ります。<br><br>サンバイザーを急に上げたり下したり、慌ててサングラスをかけたりする必要はありません。トンネルを通過するときも安心してそのまま使用できます。偏光機能付きなので太陽光だけでなくギラツキを防ぎ眼の疲労を抑えます。ダイヤルで好みの明るさに細かく調整ができます。最新の偏光・調光サングラスは紫外線だけでなく可視光線にも反応しますが、色の変化速度が遅いので、トンネル走行や屋内の駐車場など暗い場所への移動は注意が必要です。<br><br>※ユニバーサルタイプで、純正サンバイザーの縦幅が155～250mm厚さ20m～30mm以内であれば装着可能です。工具等は必要ありません。<br><br>ユニバーサル<br><br><br><br><tr><td colspan="2">
